import React from 'react'
import "./contact.css"

export default function Contact() {
  return (
    <section className="about-main section-main" id="prices">
    <div className="about-title">
      <h2>İletişim</h2>
      <h4>Yardım Madası</h4>
      <div className="section-line"> </div>
    </div>
   
  </section>
  )
}
